description:
SG-1 vindt in de Tok'ra, een vriendelijke afsplitsing van de goa'uld, en de Asgard, een technologisch zeer geavanceerd ras, bondgenoten voor hun strijd tegen de Goa'uld.

9.Secrets - 21 augustus 1998 - Daniel en Teal'c keren terug naar Abydos en vinden daar de zwangere Sha're. O'Neill en Carter gaan naar Washington om gehuldigd te worden.

10.Bane - 25 september 1998 - Teal'c wordt gestoken door een buitenaards insect en muteert langzaam.

11.The Tok'ra - deel 1 - 2 oktober 1998 - Carter heeft een flashback van Jolinar en SG-1 ontdekt zo de Tok'ra.

12.The Tok'ra - deel 2 - 9 oktober 1998 - De vader van Carter die stervende is wil zich beschikbaar stellen een gastheer voor Tok'ra te worden


